import React from "react";
import Alert from "react-bootstrap/Alert";

const MessageAlert = (props) => {
  return (
    <>
      <Alert className="text-center mt-4" variant={props.variant}>
        {props.message}
      </Alert>
    </>
  );
};

export default MessageAlert;
